    <div style={{ padding: "2rem", textAlign: "center", fontFamily: "sans-serif" }}>
      <h1>üè† Smart Property System</h1>
      <p>Welcome! Manage properties, tenants, maintenance, and payments ‚Äî all in one place.</p>

      <div style={{ marginTop: "2rem" }}>
        <Link to="/login"><button>üîê Login</button></Link>
        <Link to="/register" style={{ marginLeft: "1rem" }}><button>üìù Register</button></Link>
        <Link to="/forgot-password" style={{ marginLeft: "1rem" }}><button>üîÅ Forgot Password</button></Link>
      </div>

      <div style={{ marginTop: "2rem", fontSize: "0.9rem", color: "#555" }}>
        <p><strong>Tenants:</strong> View your property, submit maintenance, and pay rent.</p>
        <p><strong>Admins:</strong> Manage listings, tenants, payments, and access control.</p>
      </div>
    </div>
  );
};

